import React from 'react'
import { Container, Row, Col } from "reactstrap";
import './Footer.css'

import {Link} from 'react-router-dom';
import logo from "../assets//images/logo.png";

const nav_link = [
  {
    path: "/home",
    display: "Home",
  },

  {
    path: "/about",
    display: "About",
  },

  {
    path: "/tours",
    display: "Tours",
  }
];

const Footer = () => {
  return (
   <section>
    <Container>
      <Row>
        <Col lg='3'>
        </Col>
      </Row>
    </Container>
   </section>
  )
}

export default Footer
